CHAPITRE 11  
PRODUITS DE LA MINOTERIE; MALT; 
AMIDON ET FECULES; INULINE;  GLUTEN DE FROMENT 
Notes. 
1.Sont exclus du présent Chapitre :
a)les malts torréfiés, conditionnés pour servir de succédanés du café (n°s 09.01 ou 21.01,
selon le cas);
b)les farines, gruaux , semoules, amidons et fécules préparés du n° 19.01;
c) les corn flakes et autres produits du n° 19.04;
d)les légumes préparés ou conservés des n°s 20.01, 20.04 ou 20.05;
e)les produits pharmaceutiques (Chapitre 30);
f)les amidons et fécules ayant le caractère de produits de parfumerie ou de toilette préparés
ou de préparations cosmétiques (Chapitre 33).
2.A) Les produits provenant de la minoterie des céréales désignées dans le tableau ci-après
relèvent du présent Chapitre s’ils ont simultanément, en poids et sur produit sec : 
a) une teneur en amidon (déterminée d’après  la méthode polarimétrique Ewers modifiée)
excédant celle indiquée dans la colonne (2);
b) une teneur en cendres (déduction faite des matières minérales ayant pu être ajoutées)
n’excédant  pas celle mentionnée dans la colonne (3).
Ceux ne remplissant pas les conditions ci-dessus sont à classer au n° 23.02.

CHAPITRE 13 
GOMMES, RESINES ET AUTRES SUCS ET EXTRAITS VEGETAUX 
Note.
1. Le n° 13.02 comprend notamment l’extrait de réglisse, l’extrait de pyrèthre, l’extrait de
houblon, l’extrait d’aloès et l’opium.
En sont, par contre, exclus :
a) les extraits de réglisse contenant plus de 10 % en poids de saccharose ou présentés
comme sucreries (n° 17.04);
b) les extraits de malt (n° 19.01);
c) les extraits de café, de thé ou de maté (n° 21.01);
d) les sucs et extraits végétaux constituant des boissons alcooliques (Chapitre 22);
e) le camphre naturel et la glycyrrhizine et les autres produits des n°s 29.14 ou 29.38;
f) les concentrés de paille de pavot contenant au moins 50% en poids d’alcaloïdes (n° 29.39) ;
g) les médicaments des n°s 30.03 ou 30.04 et les réactifs destinés à la détermination des
groupes ou des facteurs sanguins (n° 30.06);
h) les extraits tannants ou tinctoriaux (n°s 32.01 ou 32.03);
ij) les huiles essentielles, liquides ou concrètes, les résinoïdes et les oléorésines d’extraction,
ainsi que les eaux distillées aromatiques et solutions aqueuses d’huiles essentielles et les
préparations à base de substances odoriférantes des types utilisés pour la fabrication de
boissons (Chapitre 33);
k) le caoutchouc naturel, le balata, la gutta-percha, le guayule, le chicle et les gommes
naturelles analogues (n° 40.01).

SECTION  III 
GRAISSES ET HUILES ANIMALES, VEGETALES OU D’ORIGINE  
MICROBIENNE ET PRODUITS DE LEUR DISSOCIATION;  
GRAISSES  ALIMENTAIRES  ELABOREES;  
CIRES  D’ORIGINE  ANIMALE  OU VEGETALE  
GRAISSES ET HUILES ANIMALES, VEGETALES OU D’ORIGINE  
MICROBIENNE ET PRODUITS DE LEUR DISSOCIATION;  
GRAISSES  ALIMENTAIRES  ELABOREES;  
CIRES  D’ORIGINE  ANIMALE  OU VEGETALE  
Notes.  
1.Le présent  Chapitre  ne comprend  pas :
a)le lard et la graisse  de porc ou  de volailles du  n° 02.09;
b)le beurre,  la graisse  et l’huile  de cacao  (n° 18.04);
c)les préparations alimentaires contenant en poids plus de 15 % de produits du n° 04.05 (Chapitre
21 généralement);
d)les cretons  (n° 23.01)  et les  résidus  des n°s 23.04  à 23.06;
e)les acides gras,  les cires préparées, les corps gras transformés en  produits pharmaceu tiques,  en
peintures, en vernis, en savons, en produits de parfumerie ou de toilette préparés ou en
préparations  cosmétiques,  les huiles  sulfonées et  autres produits  de la Section  VI;
f)le factice  pour caoutchouc  dérivé  des huiles (n°  40.02).
2.Le n° 15.09  ne couvre  pas les huiles  obtenues  à partir  d’olives à  l’aide  de solvants  (n° 15.10).

PREPARATIONS  ALIMENTAIRES  DIVERSES  
Notes.  
1.Le présent  Chapitre  ne comprend  pas :
a)les mélanges  de légumes  du n° 07.12;
b)les succédanés  torréfiés  du café contenant du café, en quelque proportion que ce  soit (n°
09.01);
c)le thé aromatisé  (n° 09.02);
d)les épices  et autres  produits  des n°s 09.04  à 09.10;
e)les préparations alimentaires, autres que les produits décrits aux n°s 21.03 ou 21.04,
contenant plus de 20 % en poids de saucisse, de saucisson, de viande, d’abats, de sang,
d’insectes , de poisson, de crustacés, de mollusques, d’autres invertébrés aquatiques ou
d’une  combinaison  de ces produits (Chapitre  16);
f)les produits  du n° 24.04;
g)les levures conditionnées comme médicaments et les autres produits des n°s 30.03 ou
30.04;
h)les enzymes  préparées  du n° 35.07.
2.Les extraits  des succédanés  visés à  la Note  1 b) ci-dessus relèvent  du n° 21.01.
3.Au sens du n° 21.04, on entend par préparations alimentaires composites homogénéisées,  des
préparations  consistant  en un mélange  finement  homogénéisé  de plusieurs  substances  de
base, telles que viande, poisson, légumes, fruits, conditionnées pour la vente au détail  comme
aliments pour nourrissons et enfants en bas âge ou pour usages diététiques, en  récipients  d’un
contenu  d’un poids  net n’excédant pas 250g.

I.produits  titrant 12°  ou moins d’alcool  : 90 g ou moins  d’extrait sec  total par litre ;
II.produits  titrant  plus de 12° et pas plus de 15° d’alcool  : 130 g ou moins  d’extrait  sec total par
litre ;
III.produits  titrant  plus de 15° et pas plus de 18° d’alcool  : 130 g ou moins  d’extrait  sec total par
litre ;
IV. produits  titrant  plus de 18° et pas plus de 22° d’alcool  : 330 g ou moins  d’extrait  sec total par
litre ;
Les produits présentant un extrait sec total dépassant le maximum fixé ci -dessus dans chaque  
catégorie,  doivent  être classés  dans  la première  catégorie  suivante,  étant  entendu  que si l’extrait 
sec total dépasse 330 g par litre, les produits doivent être classés dans  les sous - positions  
2204.21.10.50,  2204.21.20.50,  2204.21.90.50,  2204.22.10.50,  2204.22.20.50,  
2204.22.90.50,  2204.29.10.50, 2204.29.20.50  et 2204.29.90.50  ; 
4.Les sous -positions  2204.21,  2204.22  et 2204.29  comprennent notamment  :
a)le vin viné,  c’est-à-dire le produit :
-ayant  un titre alcoométrique  acquis  non inférieur  à 18° et non supérieur  à 24° ;
-obtenu exclusivement par adjonction d’un produit non rectifié, provenant de la distillation
du vin et ayant un titre alcoométrique acquis maximum de 86°, à un vin ne contenant pas
de sucre  résiduel,

2.- Le présent  Chapitre  ne comprend  pas : 
a)le soufre  sublimé, le  soufre  précipité  et le soufre  colloïdal  (n° 28.02);
b)les  terres  colorantes  contenant  en  poids  70  %  ou  plus  de  fer  combiné  évalué  en  Fe2O3
(n° 28.21);
c)les médicaments  et autres  produits  du Chapitre  30;
d)les produits  de parfumerie  ou de toilette  préparés  et les préparations  cosmétiques  (Chapitre  33);
e)les pisés  de dolomie (n°  38.16);
f)les pavés,  bordures  de trottoirs  et dalles  de pavage  (n° 68.01);  les cubes,  dés et articles  similaires
pour mosaiques (n°  68.02);  les ardoises pour  toitures  ou revêtements de  bâtiments  (n° 68.03);
g)les pierres gemmes  (n°s 71.02  ou 71.03);
h)les cristaux cultivés de chlorure de sodium ou d’oxyde de magnésium (autres que les éléments
d’optique) d’un poids unitaire égal ou supérieur à 2,5 g, d u n° 38.24; les éléments d’optique en
chlorure  de sodium  ou en oxyde  de magnésium (n°  90.01);
i)les craies  de billards  (n° 95.04);
k)les craies  à écrire  ou à dessiner  et les  craies  de tailleurs  (n° 96.09).
3.- Tout produit  susceptible  de relever  à la fois du n° 25.17  et d’une  autre  position  de ce Chapitre  est à 
classer au  n° 25.17.

CHAPITRE 26
MINERAIS, SCORIES ET CENDRES
Notes.
1.- Le présent Chapitre ne comprend pas :
a) les laitiers et déchets industriels similaires préparés sous forme de macadam (n° 25.17);
b) le carbonate de magnésium naturel (magnésite), même calciné (n° 25.19);
c)les boues provenant des réservoirs de stockage des huiles de pétrole, constituées principalement
par des huiles de ce type (n° 27.10) ;
d) les scories de déphosphoration du Chapitre 31;
e) les laines de laitier, de scories, de roche et les laines minérales similaires (n° 68.06);
f) les déchets et débris de métaux précieux ou de plaqués ou doublés de métaux précieux;
les autres déchets et débris contenant des métaux précieux ou des composés de métaux
précieux du type de ceux utilisés principalement pour la récupération des métaux précieux
(n°s 71.12 ou 85.49);
g) les mattes de cuivre, les mattes de nickel et les mattes de cobalt, obtenues par fusion des
minerais (Section XV).
2.- Au sens des n°s 26.01 à 26.17, on entend par minerais les minerais des espèces
minéralogiques effectivement utilisés, en métallurgie, pour l’extraction du mercure, des
métaux du n° 28.44 ou des métaux des Sections XIV ou XV, même s’ils sont destinés à des
fins non métallurgiques, mais à la condition, toutefois, qu’ils n’aient pas subi d’autres
préparations que celles normalement réservées aux minerais de l’industrie métallurgique.

3.- Sous réserve des dispositions de la Note 1 de la Section VI, le présent Chapitre ne  
comprend  pas : 
a)le chlorure de sodium et l’oxyde de magnésium, même purs, et les autres produits de la
Section  V;
b)les composés  organo -inorganiques,  autres  que ceux mentionnés  dans  la Note 2 ci-dessus;
c)les produits  visés  dans  les Notes  2, 3, 4 ou 5 du Chapitre  31;
d)les produits  inorganiques  du genre  de ceux  utilisés  comme  luminophores,  du n° 32.06;  les
frittes de verre et autres verres sous forme de poudre, de grenailles, de lamelles ou de
flocons,  du n° 32.07  ;
e)le graphite artificiel (n° 38.01), les produits extincteurs présentés comme charges pour
appareils extincteurs ou dans des grenades ou bombes extinctrices du n° 38.13; les
produits  encrivores  conditionné s dans  des emballages  de vente  au détail,  du n° 38.24,  les
cristaux  cultivés  (autres  que les éléments  d’optique)  de sels halogénés  de métaux  alcalins
ou alcalino -terreux,  d’un poids  unitaire  égal ou supérieur  à 2,5 g, du n° 38.24;
f)les pierres  gemmes,  les pierres  synthétiques  ou reconstituées,  les poudres  et égrisés  de
pierres gemmes ou de pierres synthétiques (n°s 71.02 à 71.05), ainsi que les métaux
précieux  et leurs  alliages  du Chapitre  71;
g)les métaux, même purs,

2. - Le présent Chapitre ne comprend pas :
a) les produits du n° 15.04, ainsi que le glycérol brut du (n° 15.20);
b) l’alcool éthylique (n°s 22.07 ou 22.08);
c) le méthane et le propane (n° 27.11);
d) les composés du carbone mentionnés à la Note 2 du Chapitre 28;
e) les produits immunologiques du n° 30.02;
f) l’urée (n°s 31.02 ou 31.05) ;
g) les matières colorantes d’origine végétale ou animale (n° 32.03), les matières colorantes organiques
synthétiques, les produits organiques synthétiques des types utilisés comme agents d’avivage
fluorescents ou comme luminophores (n° 32.04) ainsi que les teintures et autres matières colorantes
présentées dans des formes ou emballages pour la vente au détail (n° 32.12);
h) les enzymes (n° 35.07);
ij) sous des formes similaires impliquant leur utilisation comme combustibles, ainsi que les combustibles
liquides et gaz combustibles liquéfiés en récipients des types utilisés pour alimenter ou recharger les
briquets ou les allumeurs et d’une capacité n’excédant pas 300 cm3 (n°36.06) ;
k) les produits extincteurs présentés comme charges pour appareils extincteurs ou dans des grenades
ou bombes extinctrices du n° 38.13; les produits encrivores conditionnés dans des emballages de
vente au détail, compris dans le n° 38.24;

Produits  pharmaceutiques  
Notes.  
1.- Le présent  Chapitre  ne comprend  pas :
a)les aliments diététiques, aliments enrichis, aliments pour diabétiques, compléments alimentaires, boissons
toniques et eaux minérales, autres que les préparations nutritives administrées par voie intraveineuse
(Section  IV);
b)les produits, tels que les comprimés, les gommes à mâcher ou les timbres ou rondelles autocollants
(administrés  par voie  percutanée),  contenant  de la nicotine  et destinés  à aider  le sevrage  tabagique
(24.04);
d)les eaux  distillées  aromatiques  et solutions  aqueuses  d’huiles  essentielles,  médicinales  (n° 33.01);
e)les préparations  des n°s 33.03  à 33.07,  même  si elles  ont des propriétés  thérapeutiques  ou
prophylactiques;
f)les savons  et autres  produits  du n° 34.01  additionnés  de substances  médicamenteuses;
g)les préparations  à base  de plâtre  pour  l’art dentaire  (n° 34.07);
h)l’albumine  du sang  non préparée  en vue d’usages  thérapeutiques  ou prophylactiques  (n° 35.02)  ;
ij) les réactifs  de diagnostic  du n° 38.22.

2.- Au sens du n° 30.02, on entend par produits immunologiques les peptides et les protéines (à l’exclusion des
produits du n° 29.37) qui participent directement à la régulation des processus immunologiques tels que les
anticorps  monoclonaux  (MAB),  les fragments  d’anticorps,  les conjugués  d’anticorps  et de fragments  
d’anticorps  les interleukines,  les interférons  (IFN),  les chimiokines,  ainsi  que certains  facteurs  
onconécrosants (TNF), facteurs de croissance (GF), hématopoïétines e t facteurs de simulation de colonies  
(CSF).  
3.- Au sens des  n°s 30.03 et 30.04  et de la Note 4  d) du Chapitre,  on considère  :
a)comme  produits non  mélangés  :
1)les solutions  aqueuses  de produits  non mélangés;
2)tous  les produits  des Chapitres  28 ou 29;
3)les extraits  végétaux  simples  du n° 13.02,  simplement  titrés  ou dissous  dans  un solvant  quelconque;
b)comme  produits mélangés  :
1)les solutions  et suspensions  colloïdales  (à l’exclusion  du soufre  colloïdal);
2)les extraits  végétaux  obtenus  par le traitement  de mélanges  de substances  végétales;
3)les sels et eaux  concentrés  obtenus  par évaporation  des eaux  minérales  naturelles.

e)placebos  et trousses  pour  essais  cliniques  masqués  (ou à double  insu),  destinés  à être  utilisés  dans  le cadre
d’essais  cliniques  reconnus, présentés  sous  forme  de doses,  même  contenant  des médicaments  actifs;
f)les ciments  et autres  produits  d’obturation  dentaire;  les ciments  pour  la réfection  osseuse;
g)les trousses  et boîtes  de pharmacie  garnies,  pour  soins  de première  urgence;
h) les préparations  chimiques  contraceptives  à base  d’hormones,  d’autres  produits  du n° 29.37  ou de
spermicides  ;
ij) les préparations  présentées  sous  forme  de gel conçues  pour  être  utilisées  en médecine  humaine  ou 
vétérinaire  comme  lubrifiant  pour  certaines  parties  du corps  lors des opérations  chirurgicales  ou des 
examens médicaux  ou comme agent  de couplage  entre  le corps  et les instruments  médicaux  ; 
k)les déchets pharmaceutiques, c’est -à-dire les produits pharmaceutiques impropres à leur usage initial en
raison, par  exemple,  du dépassement  de leur date  de péremption  ;
I)les appareillages identifiables de stomie, à savoir les sacs, coupés de forme, pour colostomie, iléostomie et
urostomie  ainsi  que leurs  protecteurs  cutanés  adhésifs  ou plaques  frontales.

2.- Le n° 31.02 comprend uniquement, sous réserve qu’ils ne soient pas présentés sous les
conditionnements prévus au n° 31.05 :
a) les produits ci-après :
1) le nitrate de sodium, même pur;
2) le nitrate d’ammonium, même pur;
3) les sels doubles, même purs, de sulfate d’ammonium et de nitrate d’ammonium;
4) le sulfate d’ammonium, même pur;
5) les sels doubles (même purs) ou les mélanges de nitrate de calcium et de nitrate
d’ammonium;
6) les sels doubles (même purs) ou les mélanges de nitrate de calcium et de nitrate de
m
agnésium;
7) la cyanamide calcique, même pure, imprégnée ou non d’huile;
8) l’urée, même pure;
b) les engrais consistant en mélanges entre eux de produits visés à l’alinéa a) ci-dessus;
c) les engrais consistant en mélanges de chlorure d’ammonium ou de produits visés aux
alinéas a) ou b) ci-dessus avec de la craie, du gypse ou d’autres matières inorganiques
dépourvues de pouvoir fertilisant;
d) les engrais liquides consistant en solutions aqueuses ou ammoniacales de produits visés
aux alinéas a) 2) ou a) 8) ci-dessus, ou d’un mélange de ces produits.

3.- Le n° 31.03 comprend uniquement, sous réserve qu’ils ne soient pas présentés sous les
conditionnements prévus au n° 31.05 :
a) les produits ci-après :
1) les scories de déphosphoration;
2) les phosphates naturels du n° 25.10, grillés, calcinés ou ayant subi un traitement
thermique supérieur à celui visant à éliminer les impuretés;
3) les superphosphates (simples, doubles ou triples);
4) l’hydrogénoorthophosphate de calcium renfermant une proportion de fluor égale ou
supérieure à 0,2 %, calculée sur le produit anhydre à l’état sec;

Par contre,  le n° 34.04  ne comprend  pas : 
a)les produits des  n°s 15.16,  34.02  ou 38.23, même  s’ils présentent le  caractère  des cires;
b)les cires animales  non mélangées  et les cires végétales  non mélangées,  même  raffinées
ou colorées, du n° 15.21;
c)les cires  minérales  et les produits  similaires  du n° 27.12,  même  mélangés  entre  eux ou
simp lement colorés;
d)les cires  mélangées,  dispersées  ou dissoutes  dans  un milieu  liquide  (n°s 34.05,  38.09,CHAPITRE  34

CHAPITRE  36 
Notes.  POUDRES ET EXPLOSIFS; ARTICLES DE PYROTECHNIE;  
ALLUMETTES;  ALLIAGES  PYROPHORIQUES;  
MATIERES  INFLAMMABLES  
1.- Le présent  Chapitre  ne comprend  pas les produits  de constitution  chimique  définie  présentés  isolément,  à 
l’exception,  toutefois,  de ceux  visés  par les Notes  2 a) ou  2 b) ci-dessous.  
2.- On entend  par articles  en matières  inflammables , au sens  du n° 36.06,  exclusivement  : 
a)le métaldéhyde, l’ hexaméthylènetétramine et les produits similaires, présentés en tablettes, bâtonnets ou sous
des formes  similaires  impliquant  leur utilisation  comme  combustibles,  ainsi que les  combustibles  à base
d’alcool et  les combustibles préparés  similaires,  présentés  à l’état  solide  ou pâteux;
b)les combustibles liquides et  gaz combustibles liquéfiés en récipients des types  utilisés pour alimenter ou
recharger les  briquets  ou les allumeurs  et d’une  capacité  n’excédant  pas 300  cm3;
c)les torches  et flambeaux  de résine,  les allume -feu et similaires.

Notes.  PRODUITS  DIVERS DES  INDUSTRIES  CHIMIQUES  
1.- Le présent  Chapitre  ne comprend  pas : 
a)les produits  de constitution  chimique  définie  présentés  isolément,  autres  que ceux  ci-
après  :
1)le graphite  artificiel  (n° 38.01);
2)les insecticides, antirongeurs, fongicides, herbicides, inhibiteurs de germination et régulateurs de
croissance  pour plantes,  désinfectants  et produits  similaires,  présentés  dans  des formes  ou
emballages  prévus  au n° 38.08;
3)les produits  extincteurs  présentés  comme  charges  pour appareils  extincteurs  ou dans  des grenades
ou bombes  extinctrices  (n° 38.13);
4)les matériaux  de référence  certifiés,  spécifiés  dans  la Note 2 ci-après;
5)les produits  visés  dans  les Notes  3 a) ou 3 c) ci-après;
b)les mélanges  de produits  chimiques  et de substances  alimentaires  ou autres  ayant  une valeur  nutritive,
des types  utilisés  dans  la préparation  d’aliments  pour la consommation  humaine  (n° 21.06
généralement)  ;
c)les produits  du n° 24.04;
d)les scories, cendres et résidus (y compris les boues, autres que les boues d’épuration) contenant des
métaux,  de l’arsenic  ou leurs  mélanges  et remplissant  les conditions  de la Note  3 a) ou 3 b) du Chapitre
26 (n°26.20)  ;
e)les médicaments  (n°s 30.03  ou 30.04)  ;

débris électriques et électroniques (y compris les batteries usagées) qui suivent leur régime 
propre ; b)les déchets  industriels  ;
c)les déchets  pharmaceutiques,  tels que définis  par la note 4 k) du Chapitre  30 ;
d)les déchets  cliniques  définis  à la Note 6 a) ci-dessous.
5.- Aux fins du n° 38.25,  par boues  d’épuration  on entend  les boues  provenant  des stations  d’épuration  des eaux  
usées  urbaines  et les déchets  de prétraitement,  les déchets  de curage  et les boues  non stabilisées.  Les boues  
stabilisées,  qui sont aptes  à être utilisées  en tant qu’engrais  sont exclues  (Chapitre  31). 
6)Aux fins du n° 38.25, l’expression  autres  déchets  couvre  :
a) les déchets cliniques, c’est -à-dire les déchets contaminés provenant de la recherche médicale, des travaux
d’analyse  ou d’autres  traitement  médicaux,  chirurgicaux,  dentaires  ou vétérinaires  qui contiennent  souvent  des
agents  pathogènes  et des substances  pharmaceutiques  et qui doivent  être détruits  de manière  particulière  (par
exemple  : pansements,  gants  usagés  et seringues  usagées)  ;
b)les déchets  de solvants  organiques  ;
c)les déchets  de solutions  (liqueurs)  décapantes  pour métaux,  de liquides  hydrauliques,  de liquides  pour freins
et de liquides  antigel  ;
d)les autres  déchets  des industries  chimiques  ou des industries  connexes.

Ces termes ne s’appliquent toutefois pas aux matières à considérer comme des
matières textiles de la Section XI.
2.- Le présent Chapitre ne comprend pas :
